import { NavLink } from "react-router-dom";

const Navbar = () => {
    return (
        <div className="navbar-main">
            <div className="navbar-container">
                <NavLink to="/" className="inactive navlink" activeClassName="active">Home</NavLink> 
                <NavLink to="/about-me" className="inactive navlink" activeClassName="active">Movies</NavLink> 
                <NavLink to="/resume" className="inactive navlink" activeClassName="active">Login</NavLink>
                <NavLink to="/resume" className="inactive navlink" activeClassName="active">Sign-up</NavLink>
            </div>
        </div>
    );
}

export default Navbar;
